import React from 'react';
import Link from 'next/link';

function Template() {
	return (
		<>
			<div>Index</div>
			<Link href="/test">
				{/* eslint-disable-next-line jsx-a11y/anchor-is-valid */}
				<a title="TEST">Go TEST</a>
			</Link>
		</>
	);
}

export default Template;
